import React, { useEffect, useState } from 'react';

const Resume = () => {
  const [animateSkills, setAnimateSkills] = useState(false);

  useEffect(() => {
    setAnimateSkills(true);
  }, []);

  const experiences = [
    {
      title: 'Software Engineer at Company XYZ',
      period: 'Jan 2022 - Present',
      description: 'Developed and maintained web applications using React and Node.js.',
    },
    {
      title: 'Junior Developer at Company ABC',
      period: 'Jun 2020 - Dec 2021',
      description: 'Assisted in building RESTful APIs and integrating third-party services.',
    },
  ];

  const education = [
    {
      degree: 'B.S. in Computer Science',
      institution: 'University of Example',
      period: '2016 - 2020',
    },
  ];

  const skills = [
    { name: 'React', level: 90 },
    { name: 'Node.js', level: 85 },
    { name: 'Tailwind CSS', level: 80 },
    { name: 'JavaScript', level: 95 },
  ];

  return (
    <div className="space-y-12">
      {/* Download Resume Button */}
      <div className="text-center">
        <a
          href="/path-to-your-resume.pdf"
          download
          className="inline-block px-6 py-3 bg-gradient-to-r from-blue-500 to-purple-600 text-white font-semibold rounded-full shadow-lg transform transition-all duration-300 hover:scale-105 hover:shadow-xl"
        >
          Download Resume
        </a>
      </div>

      {/* Experience Timeline */}
      <div>
        <h3 className="text-2xl font-bold text-gray-800 mb-6">Experience</h3>
        <div className="relative">
          {experiences.map((exp, index) => (
            <div key={index} className="mb-8 flex items-start">
              {/* Timeline Dot and Line */}
              <div className="flex flex-col items-center mr-6">
                <div className="w-4 h-4 bg-blue-600 rounded-full"></div>
                {index !== experiences.length - 1 && (
                  <div className="w-1 h-full bg-blue-600/20 mt-2"></div>
                )}
              </div>
              {/* Experience Card */}
              <div className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300 w-full">
                <h4 className="text-lg font-semibold text-gray-800">{exp.title}</h4>
                <p className="text-sm text-gray-500">{exp.period}</p>
                <p className="text-gray-600 mt-2">{exp.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Education Timeline */}
      <div>
        <h3 className="text-2xl font-bold text-gray-800 mb-6">Education</h3>
        <div className="relative">
          {education.map((edu, index) => (
            <div key={index} className="mb-8 flex items-start">
              <div className="flex flex-col items-center mr-6">
                <div className="w-4 h-4 bg-blue-600 rounded-full"></div>
                {index !== education.length - 1 && (
                  <div className="w-1 h-full bg-blue-600/20 mt-2"></div>
                )}
              </div>
              <div className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300 w-full">
                <h4 className="text-lg font-semibold text-gray-800">{edu.degree}</h4>
                <p className="text-sm text-gray-500">{edu.institution}</p>
                <p className="text-sm text-gray-500">{edu.period}</p>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Skills with Animated Progress Bars */}
      <div>
        <h3 className="text-2xl font-bold text-gray-800 mb-6">Skills</h3>
        <div className="space-y-4">
          {skills.map((skill, index) => (
            <div key={index} className="flex items-center">
              <span className="w-32 text-gray-700 font-medium">{skill.name}</span>
              <div className="flex-1 bg-gray-200 rounded-full h-3 overflow-hidden">
                <div
                  className={`bg-gradient-to-r from-blue-500 to-purple-600 h-full rounded-full transition-all duration-1000 ease-out ${
                    animateSkills ? 'opacity-100' : 'opacity-0'
                  }`}
                  style={{ width: animateSkills ? `${skill.level}%` : '0%' }}
                ></div>
              </div>
              <span className="ml-4 text-gray-600">{skill.level}%</span>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Resume;
